//reset iScroll
function resetIscrool(holder) {
	var iScrollInst = holder.closest('.fp-scrollable').data('iscrollInstance');

	if (iScrollInst && typeof iScrollInst != 'undefined') {
		iScrollInst.refresh()
	} else if (jQuery.fn.fullpage && jQuery.fn.fullpage.reBuild && holder.parents('.fp-auto-height') ==  false) {
		jQuery.fn.fullpage.reBuild();
	}
}


// collapse element init
function initColapse() {
	var animSpeed = 270;

	jQuery('.collapse-holder').each(function(){
		var holder = jQuery(this);
		var btn = holder.find('.collapse-btn');
		var collapseElement= holder.find('.collapse').css('transitionDuration', animSpeed / 1000 + 's');
		var animTimer = null;

		btn.on('click', function(e){
			e.preventDefault();
			if(holder.hasClass('collapse-other')){
				jQuery('.collapse-holder').not(holder).removeClass('collapsed');
			}
			holder.toggleClass('collapsed');
			clearTimeout(animTimer);
			animTimer = setTimeout(function() {
				resetIscrool(holder);
			}, animSpeed);
		});

		function refreshMaxHeight() {
			collapseElement.css('maxHeight', '');
			collapseElement.css('maxHeight', collapseElement.prop('scrollHeight'));
		}

		refreshMaxHeight();
		jQuery(window).on('load resize orientationchange click', refreshMaxHeight);
	});
}

