// animated navigation init
function initDropDown() {
	var menuInst = jQuery('body').data('MobileNav');
	var activeLinkClass = 'opener-active';
	var wpActiveLinkClass = 'current-menu-ancestor';

	jQuery('.main-nav-holder').each(function() {
		var holder = jQuery(this);
		var bradcrumbs = holder.find('.breadcrumb-nav');
		var nav = holder.find('.main-nav').css('position', 'relative');
		var items = nav.find('li');
		var bradcrumbsItems = [];
		var defaultBradcrumbText = bradcrumbs.data('defaultBradcrumbText') || bradcrumbs.find('span').eq(0).text();

		generateBreadcrumbs(0, defaultBradcrumbText);

		// add classes if item has dropdown
		nav.find('li').each(function() {
			var item = jQuery(this);
			var drop = item.find('> .submenu');
			var link = item.find('> a');

			if(drop.length) {
				item.addClass('has-drop-down');
				if(link.length) link.addClass('arrow');
			}
		});

		// set level index attr
		function setLevel(list, index) {
			list.children('li:has(.submenu)').each(function() {
				var item = jQuery(this);
				var drop = item.find('> .submenu');

				item.attr('data-level', index + 1);

				setLevel(drop.find('> ul'), index + 1);
			});
		}

		// set start level index attr
		setLevel(nav, 0);

		nav.find('li').each(function() {
			var item = jQuery(this);
			var link = item.find('> .arrow');

			// attach link click handler
			link.on('click', function(e) {
				e.preventDefault();

				showDrop(item, link);
			});
		});

		// attach bradcrumbs click handler
		bradcrumbs.on('click', 'a', function(e) {
			e.preventDefault();

			var index = jQuery(this).data('index');
			var item = items.filter('[data-level="' + index + '"]');
			var link = item.find('> .arrow');

			if (bradcrumbsItems.length > 1) {
				hideDrop(item, link);
			}

		});

		// hide drop
		function hideDrop(item, link) {
			item.find('.' + activeLinkClass).removeClass(activeLinkClass);

			generateBreadcrumbs(item.data('level'), link.text(), true);
		}

		// show drop
		function showDrop(item, link) {
			item.siblings().find('.' + activeLinkClass).removeClass(activeLinkClass);
			link.addClass(activeLinkClass);

			generateBreadcrumbs(item.data('level'), link.text());
		}

		// add new breadcrumb
		function addNewBreadcrumb(index, text) {
			bradcrumbsItems[index] = text;
		}

		// generate breadcrumbs
		function generateBreadcrumbs(index, text, bcClick) {
			bradcrumbsItems.length = index;

			if (!bcClick) {
				addNewBreadcrumb(index, text);
			}

			bradcrumbs.empty();

			for (var i = 0, length = bradcrumbsItems.length; i < length; i++) {
				bradcrumbs.append('<span><a href="#" data-index="' + (i + 1) + '">' + bradcrumbsItems[i] + '</a></span>');
			}
		}

		function prerenderBreadcrumb() {
			nav.find('li').each(function() {
				var item = jQuery(this);
				var link = item.find('> .arrow');

				if (item.hasClass(wpActiveLinkClass) && link.length) {
					showDrop(item, link);
				}
			});
		}

		prerenderBreadcrumb();

		// reset breadcrumbs
		if (menuInst) {
			menuInst.options.onHide = function() {
				items.find('.' + activeLinkClass).removeClass(activeLinkClass);

				generateBreadcrumbs(0, defaultBradcrumbText);

				prerenderBreadcrumb();
			};
		}
	});
}

