function initDataTable() {
	jQuery('.responsive-table').each(function() {
		var table = jQuery(this);

		var tableAPI = table.DataTable({
			"paging": false,
			"searching": false,
			"info": false,
			columnDefs: [
				{ targets: 'no-sort', orderable: false }
			],
			responsive: {
				breakpoints: [
					{ name: 'desktop', width: Infinity },
					{ name: 'tablet', width: 1023 },
					{ name: 'mobile', width: 767 }
				]
			},
		});

		table.on('mouseenter', 'td', function() {
			var cells = tableAPI.cell(this).index();

			if(cells) {
				var colIdx = tableAPI.cell(this).index().column;

				jQuery(tableAPI.cells().nodes()).removeClass('highlight');
				jQuery(tableAPI.column(colIdx).nodes()).addClass('highlight');
			}
		});
	});

	jQuery('.display-table:not(#cap_gains-table)').each(function(){
		var table = jQuery(this);

		var tableAPI = table.DataTable({
			"paging": false,
			"searching": false,
			"info": false
		});

		table.on('mouseenter', 'td', function(){
			var colIdx = tableAPI.cell(this).index().column;

			jQuery(tableAPI.cells().nodes()).removeClass('highlight');
			jQuery(tableAPI.column(colIdx).nodes()).addClass('highlight');
		});
	});
}

function initFullPage() {
	var $fullpage = jQuery('#fullpage');

	if ($fullpage.length) {
		var noScrolling = !jQuery('#fullpage.no-autoscroll').length;
		var anchors = [];

		jQuery('.fp-block').each(function(i, e){
			var anchor = '';
			if( typeof jQuery(this).data('anchor') !== 'undefined' ){
				anchor = jQuery(this).data('anchor');
			}else if( typeof jQuery(this).attr('id') !== 'undefined' ){
				var id = jQuery(this).attr('id');
				anchor = '_' + id;
			}else{
				anchor = 'slide' + (i+1);
			}
			anchors.push(anchor);
		});

		$fullpage.addClass('fp-init');

		$fullpage.fullpage({
			verticalCentered: false,
			sectionSelector: '.fp-block',
			scrollOverflow: noScrolling,
			scrollingSpeed: 1200,
			autoScrolling: noScrolling,
			fitToSection: noScrolling,
			responsiveWidth: 290,
			anchors: anchors,
			menu: '#anchor-menu',
			css3: true,
			normalScrollElements: '.selectize-dropdown',
			bigSectionsDestination: top,
			afterResponsive: function(isResponsive) {
				if (isResponsive) {
					$fullpage.removeClass('fp-init');
				} else {
					$fullpage.addClass('fp-init');
				}
			},
			onLeave: function (index, nextIndex, direction) {
				var animateSection,
						raf = function(cb) {
							requestAnimationFrame(function() {
								requestAnimationFrame(cb);
							});
						};

				if (direction === 'down') {
					animateSection = this.next();

					animateSection.removeClass('animate');
					animateSection.addClass('to-top-animate');

					raf(function() {
						animateSection.addClass('animate');
						animateSection.removeClass('to-top-animate');
					});
				} else {
					animateSection = this;

					animateSection.addClass('animate');

					raf(function() {
						animateSection.addClass('to-top-animate');
					});
				}
			},
			afterLoad: function() {
				this.removeClass('animate to-top-animate');
			}
		});
	}

	if(jQuery('#fullpage-parallax').length) {
		var noScrolling2 = !jQuery('#fullpage-parallax.no-autoscroll').length;
		jQuery('#fullpage-parallax').fullpage({
			verticalCentered: false,
			sectionSelector: '.fp-block',
			scrollOverflow: noScrolling2,
			scrollingSpeed: 1000,
			autoScrolling: noScrolling2,
			fitToSection: noScrolling2,
			responsiveWidth: 0,
			anchors: ['slide1', 'slide2', 'slide3', 'slide4', 'slide5'],
			css3: true,
			normalScrollElements: '.selectize-dropdown',
			slidesNavigation: true,
			loopHorizontal: false,
			afterRender: function () {
				var pluginContainer = jQuery(this),
					navOffset = jQuery('.fp-slidesNav').offset(),
					navWidth = jQuery('.fp-slidesNav').width(),
					navLeft = navOffset.left,
					windowWidth = jQuery(window).width(),
					navRight = windowWidth - navLeft - navWidth;
                jQuery('.fp-controlArrow.fp-prev').css('left', navLeft + 10);
                jQuery('.fp-controlArrow.fp-next').css('right', navRight + 10);

                jQuery('#slide1_1').find('.year').addClass('active');
                jQuery('#slide1_1').find('.bg-img').addClass('active');

                jQuery('.fp-slidesNav li').each(function () {
					var index = jQuery(this).index(),
						slideIndex = index + 1,
						year = jQuery('#slide1_' + slideIndex).attr('data-year');
                    jQuery(this).find('a').attr('data-nav-year', year);
				});
			},
			afterSlideLoad: function (anchorLink, index, slideAnchor, slideIndex) {
				var indexLoad = slideIndex + 1,
					slide = jQuery('#' + anchorLink + '_' + indexLoad),
					slideCount = jQuery('.fp-slide').length;
				slide.find('.year').addClass('active');
				slide.find('.bg-img').addClass('active');
				if(slide.hasClass('dark-nav')){
					jQuery('.fp-controlArrow, .fp-slidesNav').addClass('dark');
				} else {
					jQuery('.fp-controlArrow, .fp-slidesNav').removeClass('dark');
				}

				if(indexLoad == 1){
					jQuery('.fp-controlArrow.fp-prev').addClass('disabled');
					jQuery('.fp-controlArrow.fp-next').removeClass('disabled');
				} else if(indexLoad == slideCount){
					jQuery('.fp-controlArrow.fp-next').addClass('disabled');
					jQuery('.fp-controlArrow.fp-prev').removeClass('disabled');
				}else{
					jQuery('.fp-controlArrow.fp-prev').removeClass('disabled');
					jQuery('.fp-controlArrow.fp-next').removeClass('disabled');
				}

				var maxIndex = jQuery(this).parent().children().length - 1;
				isLastSlide = slideIndex === maxIndex;
			},
			onSlideLeave: function (anchorLink, index, slideIndex, direction, nextSlideIndex) {
				var indexLeave = slideIndex + 1;
                jQuery('#' + anchorLink + '_' + indexLeave).find('.year').removeClass('active');
                jQuery('#' + anchorLink + '_' + indexLeave).find('.bg-img').removeClass('active');
			},
			onLeave: function (index, nextIndex, direction) {
				isFirstSection = nextIndex === 1;
			}

		});

		var isLastSlide = false;
		var isFirstSection = true;

		function scrollHandler(e) {
			e.preventDefault();
			var delta = e.deltaY;

			if (delta > 0) {
				if (isFirstSection) {
					jQuery.fn.fullpage.moveSlideLeft();
				} else {
					jQuery.fn.fullpage.moveSectionUp();
				}
			} else if (delta < 0) {
				if (isLastSlide) {
					jQuery.fn.fullpage.moveSectionDown();
				} else {
					jQuery.fn.fullpage.moveSlideRight();
				}
			}
		}

		if (!isTouchDevice()) {
			jQuery.fn.fullpage.setAllowScrolling(false, 'down, up');
		}

		jQuery(document).on('mousewheel', jQuery.debounce( 500, true, scrollHandler));
	}

	jQuery(document).on('click', '.anhor-link', function(e) {
		e.preventDefault();
		jQuery.fn.fullpage.moveSectionDown();
	});
}

// initialize custom scroll
function initNiceScroll() {
	jQuery('.scroll-holder').each(function() {
		var holder = jQuery(this);
		var wrap = holder.find('.scroll-wrap')[0];
		var table = holder.find('.table-sticky');
		var fixedColumn = table.find('thead th:first-of-type, tbody tr td:first-of-type');
		var prevArrow = jQuery();
		var nextArrow = jQuery();
		var resizeTimeer = null;

		var niceScrollAPI = holder.niceScroll(wrap, {
			cursorwidth: "48px",
			autohidemode: false,
			emulatetouch: true,
			bouncescroll: false,
			cursordragontouch: true,
			enablemousewheel: true,
			enabletranslate3d: true,
      smoothscroll: false
		});

		niceScrollAPI.doScrollLeft = function(x, spd) {
			var y = niceScrollAPI.getScrollTop();
			niceScrollAPI.doScrollPos(x, y, spd);
		};

		niceScrollAPI.doScrollPos = function(x, y, spd) {  //direct
			var nx = (x > niceScrollAPI.page.maxw) ? niceScrollAPI.page.maxw : x;
			var ny = (y>niceScrollAPI.page.maxh) ? niceScrollAPI.page.maxh : y;

			if (nx < 0) nx = 0;
			if (ny < 0) ny = 0;

			niceScrollAPI.setScrollTop(y);
			niceScrollAPI.setScrollLeft(x);
		};

		niceScrollAPI.bind(niceScrollAPI.docscroll, 'scroll', function() {
			var scrollLeftPosition = niceScrollAPI.getScrollLeft();

			nextArrow.removeClass('nice-scroll-inactive');
			prevArrow.removeClass('nice-scroll-inactive');

			if(scrollLeftPosition <= 0) {
				prevArrow.addClass('nice-scroll-inactive');
			} else if(scrollLeftPosition >= niceScrollAPI.page.maxw) {
				nextArrow.addClass('nice-scroll-inactive');
			}

			fixedColumn.css({
				'transform': 'translate(' + Math.max(0, Math.min(niceScrollAPI.page.maxw, scrollLeftPosition)) + 'px, 0px)'
			});
		});

		// display buttons
		function togleVisableButtons() {
			clearTimeout(resizeTimeer);

			resizeTimeer = setTimeout(function() {
				if(niceScrollAPI.page.maxw <= 0) {
					nextArrow.css('display', 'none');
					prevArrow.css('display', 'none');
					holder.removeClass('scroll-holder-active');
				} else {
					nextArrow.css('display', 'block');
					prevArrow.css('display', 'block');
					holder.addClass('scroll-holder-active');

				}}, 500);
		}

		jQuery(window).on('load', togleVisableButtons);

		niceScrollAPI.bind(window, "resize", togleVisableButtons);

		buildArrows();

		// create buttons
		function buildArrows() {
			prevArrow = jQuery('<button class="nice-scroll-prev nice-scroll-arrow" aria-label="Previous" type="button"><span class="sr-only">Previous</span></button>');
			nextArrow = jQuery('<button class="nice-scroll-next nice-scroll-arrow" aria-label="Next" type="button"><span class="sr-only">Next</span></button>');

			holder.append(prevArrow);
			holder.append(nextArrow);
		}

		nextArrow.on('click', {direction: 1}, moveScroll);
		prevArrow.on('click', {direction: -1}, moveScroll);

		// moveScroll
		function moveScroll(e) {
			var direction = e.data.direction;
			var x = holder.scrollLeft() || 0;

			holder.getNiceScroll(0).doScrollLeft(x + 100 * direction, 60);
		}
	});
}

// initialize custom select
function initCustomSelect() {
	jQuery('.fake-select-holder').each(function() {
		var select = jQuery(this).find('select');

		ResponsiveHelper.addRange({
			'768..': {
				on: function() {
					select.selectize({
						create: true,
						sortField: {
							field: 'text',
							direction: 'asc'
						}
					});

					jQuery(window).on('scroll.scrollEvent', function() {
						select.each(function() {
							if (this.selectize.isOpen) this.selectize.close();
						});
					});

					jQuery('body').on('click.clickEvent',function(e) {
						var targetNode = jQuery((e.changedTouches ? e.changedTouches[0] : e).target);

						if (!targetNode.closest('.selectize-dropdown').length && !targetNode.closest('.selectize-control').length) {
							select.each(function() {
								if (this.selectize.isOpen) this.selectize.close();
							});
						}
					});
				},
				off: function() {
					select[0].selectize.destroy();
					jQuery(window).off('scroll.scrollEvent');
					jQuery('body').off('click.clickEvent');
				}
			}
		});
	});
}

