function GetIEVersion() {
	var sAgent = window.navigator.userAgent;
	var Idx = sAgent.indexOf("MSIE");

	// If IE, return version number.
	if (Idx > 0)
		return parseInt(sAgent.substring(Idx+ 5, sAgent.indexOf(".", Idx)));

	// If IE 11 then look for Updated user agent string.
	else if (!!navigator.userAgent.match(/Trident\/7\./))
		return 11;

	else
		return 0; //It is not IE
}

if (GetIEVersion() > 0)
	jQuery('html').addClass('ie11');

function slideHeight(){
	var height = jQuery(window).height(),
		headerHeight = jQuery('#header').outerHeight();
	jQuery('.international-page .container').css('min-height', height - headerHeight + 'px');
	jQuery('.international-page .fp-slide').css('height', height - headerHeight + 'px');
}
jQuery(window).on('load resize orientationchange', slideHeight);

function getRows() {
	jQuery('.section-strategies .text-box .text, .tab-section .text').each(function(){
		var $el = jQuery(this),
			elHeight = $el.height(),
			line_height = $el.css('line-height'),
		    rows = elHeight / parseFloat(line_height);
		if(Math.round(rows) < 11) {
			$el.parents('.collapse-holder').addClass('full');
		} else {
			$el.parents('.collapse-holder').removeClass('full');
		}
	})
}
jQuery(window).on('load resize orientationchange', getRows);